In Seattle, detective Quentin Conners is unfairly suspended and his partner Jason York leaves the police force after a tragic shooting on Pearl Street Bridge, when the hostage and the criminal die. When a bank is heist with hostage situation, Conners is assigned in charge of the operation having the rookie Shane Dekker as partner. The thieves, leaded by Lorenz, apparently do no steal a penny from the bank. While chasing the gangsters, the police team discloses that they planted a virus in the system, stealing one billion dollars from the most different accounts, using the principle of the Chaos Theory. Further, they find that Lorenz is killing his accomplices. Written by Claudio Carvalho, Rio de Janeiro, Brazil
